import React, { Component } from 'react'
import logo from "../Constant/logo.svg";
import "./NavBar.css";

class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {


    return (
      <div className="navbar">
        <div className="navbar-container">
          <div className="navbar-logoContainer">
            <img src={logo} />
          </div>

          {/* Tabs/Route */}
          <div className="navbar-tabContainer">
            <a><span>Works Projects</span></a>
            <a><span>Tab A</span></a>
            <a><span>Tab A</span></a>
            <a><span>Tab A</span></a>
          </div>

        </div>
      </div>
    );
  }
}

export default NavBar;
